description:
Больше известный под прозвищем «Охотник на Пиратов», Зоро — мечник «Пиратов Соломенной Шляпы». Второй по силе член экипажа. Груб и эмоционален. Совершенствовал свои навыки боя, путешествуя с Джонни и Ёсаку, парочкой друзей, и ловя пиратов. Некоторое время спустя попал в переделку с морскими дозорными, откуда его вытащил Луффи. После этого всё время находится с командой, побеждая всё новых и новых противников как вначале в Ист Блю, так потом и на Гранд Лайн.Цель Зоро — стать самым искусным фехтовальщиком, чему он и посвятил свою жизнь, постоянно совершенствуя своё мастерство. Конечная цель Зоро — победа в схватке с человеком по прозвищу «Соколиные Глаза» Михоук, лучшим фехтовальщиком мира, который небезосновательно был назван одним из персонажей как «монстр среди монстров». В течение двухлетней разлуки, по совпадению, находился с Михоуком на одном острове и, переступив через свою гордость, попросил последнего его тренировать. После двухлетней тренировки без труда разрубил под водой огромный галеон.
спойлерС малых лет вместе со многими другими местными детьми обучался боевым искусствам в додзё деревни Симоцуки. Как и все, он желал стать выдающимся мечником, но этого мальчику было мало — он хотел стать лучшим. И первой преградой на его пути стала дочь владельца додзё, Куина, которую он не мог победить, сколько бы раз не дрался против неё и сколько бы мечей не было в его руках. Со временем они начали общаться больше, Зоро узнал Куину лучше, и к соперничеству прибавилась ещё и дружба. В это время они и пообещали друг другу, что кто-то из них в будущем обязательно станет самым великим мечником во всём мире. Постепенно Зоро привык к трёхмечевому стилю, но как только он стал более-менее уверен в своих силах против Куины, та погибла глупой смертью — упав с лестницы. В одной из глав показано, как отец Луффи, Монки Д. Драгон, забирает кого-то смертельно раненного на своём корабле, на фоне тренировок Зоро. С тех пор Зоро придерживается их обещания и всеми силами старается приблизить будущее «самого великого мечника» к себе.

ВнешностьВысокий парень со смуглой кожей и натренированным телом. Лицо пребывает чаще всего в четырёх состояниях: «сонный, не обращать внимания», «удивлённо таращить глаза», «достали до такой степени, что сейчас применю новую технику» или «довольная улыбка, перед которой поставили очередную пинту эля». Волосы короткие, зелёные, ёжиком, поэтому его иногда называют «голова-трава» или просто «маримо». Одежда — практически всегда носит с собой три меча. Одевается обычно в тёмные штаны, такого же цвета ботинки, белую майку и зелёный харамаки вокруг пояса. Если эта одежда всё ещё может варьироваться, то некоторые элементы остаются неизменными — три серьги в левом ухе и бандана, повязанная вокруг левой руки. Во время серьёзных схваток бандана надевается на голову. После двухлетней тренировки у него остался шрам через левый глаз. Лишился ли он самого глаза, или закрытый глаз — часть тренировки, пока неизвестно.ХарактерОбычно показанный серьёзным и адекватным человеком, Зоро иногда теряет свой характер в пользу эмоций при каких-либо обстоятельствах и ведёт себя глупо, если даже не комично. При этом у Зоро отлично развита логика, поэтому, в случае принятия важных решений, именно он говорит по существу и в точку. Решения капитана для него являются истиной в последней инстанции, а забота об имидже капитана — едва ли не первейшая его задача, так как (по его словам), если приказы капитана не будут исполняться, он первый покинет команду. Верит в Луффи и подчиняется его решениям, какими бы безумными они ни были. Готов был ради Луффи, в частности, отдать свою жизнь в Триллер Барке и забыть про свою мечту. С командой отношения ровные, кроме «заклятого друга» и соперника в силе Санджи, ради которого и капитана принял на себя всё от Бартоломью Кумы в арке «Триллер Барк».ПривычкиНаходясь на корабле, либо тренируется, либо спит, что часто заканчивается для него плачевно — побудка весьма жестока и чаще всего происходит от удара Нами или пинка Санджи. Питает неимоверную страсть к сакэ (почти до такой же степени, что Луффи к мясу), но никогда не напивается, так как у него, как и у Нами, хороший иммунитет к алкоголю (возможно, даже лучше), ведь воин должен быть всегда начеку. Даже находясь на прямой дороге без развилок, Зоро может заблудиться. У него напрочь отсутствует чувство ориентации в пространстве (топографический кретинизм). Хотя это не помешало Зоро первым, после двухлетней тренировки, приплыть на архипелаг Сабаоди (не без помощи Пероны).ТехникиСражается, используя уникальный стиль трёх мечей, при этом держит третью катану в зубах. Также хорошо владеет техниками боя одним и двумя мечами. В названиях многих атак использует комбинации частей различных японских слов, которые вместе звучат совершенно иначе и неузнаваемо. Имеет следующие катаны:
 «Вадо Итимондзи» — меч, в прошлом принадлежавший Куине;

 «Сандай Китэцу» — считается проклятым. Каждый из предыдущих хозяев меча умирал при загадочных обстоятельствах, примерно через год после приобретения. Достался Ророноа даром в Логтауне;

 «Юбасири» — подарен хозяином оружейной лавки в Логтауне. Во время событий «Эниес Лобби» уничтожен одним из капитанов Флота;

 «Сюсуй» — достался Зоро после победы над Рюмой, давно погибшим самураем, чьё тело было оживлено Морией.
спойлер После того как Зоро отдал Сюсуй, он получил другую легендарную катану страны Вано — Энму.


 «Энма» — это мэйто катана, которой когда-то обладал Кодзуки Одэн наряду с Амэ но Хабакири.
спойлерЭту катану Зоро получил в обмен на Сюсуй.
